import React, {Component, useState} from "react";
import {Col, CustomInput, Label, ListGroup, ListGroupItem, Row} from "reactstrap";
import {ChevronDown, ChevronRight} from "react-feather";
import Translate from "../../../Translate";

function SubMenu (props) {


  return (
      <li className={"list-group-item list-group-item-action no-border  bg-lighten-4"} key={props.key}>
        <Row className="todo-list-group-item">
          <Col sm="1" md="1"><Label onClick={() => handleChecked()}><CustomInput type="checkbox" key={props.key} checked={props.checked} defaultChecked={props.checked}/></Label></Col>
          <Col sm="10" md="10" onClick={() => handleOpen()}><p className="mb-0 font-small-3"><Translate name={props.name}/></p></Col>
          <Col sm="1" md="1">
            <Chevron {...props}/>
          </Col>
        </Row>
        <SubMenuItem {...props}/>
      </li>
  );
};

class ListGroupDisabled extends Component {
  constructor(props) {
    super(props)

  }
  render() {
    console.log(this.props.data)
    return (
        <div>
          <ListGroup>
            <ListGroupItem disabled tag="a" href="#">
              Cras justo odio
              <ListGroup>
                <ListGroupItem disabled tag="a" href="#">
                  Cras justo odio
                </ListGroupItem>
                <ListGroupItem tag="a" href="#">
                  Dapibus ac facilisis in
                </ListGroupItem>
              </ListGroup>
            </ListGroupItem>
            <ListGroupItem tag="a" href="#">
              Dapibus ac facilisis in
            </ListGroupItem>
            <ListGroupItem tag="a" href="#">
              Morbi leo risus
            </ListGroupItem>
            <ListGroupItem tag="a" href="#">
              Porta ac consectetur ac
            </ListGroupItem>
            <ListGroupItem tag="a" href="#">
              Vestibulum at eros
            </ListGroupItem>
          </ListGroup>
        </div>
    );
  }
}

export default ListGroupDisabled;
